    },
            categoryPlants: {
                height: '60%',
            width: '100%',
            backgroundColor: 'white'
    },
            button:{
                flexDirection: 'row',
            height: 50,
            backgroundColor: 'yellow',
            alignItems: 'center',
            justifyContent: 'center',
            marginTop: 50,
            elevation:3,
    }

})

